const canvas = document.getElementById("matrix");
const image = document.getElementById('image');
const ctx = canvas.getContext("2d");

canvas.height = window.innerHeight;
canvas.width = window.innerWidth;

// characters for the Matrix effect
const chars = "01";

// convert the string into an array
const matrix = chars.split("");

const fontSize = 16;
const columns = canvas.width / fontSize;
const drops = [];

// initialize drops
for (let x = 0; x < columns; x++) {
  drops[x] = 1;
}

// draw the characters
function draw() {
  ctx.fillStyle = "rgba(0, 0, 0, 0.05)";
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  ctx.fillStyle = "#03A062"; // green text
  ctx.font = fontSize + "px monospace";

  for (let i = 0; i < drops.length; i++) {
    const text = matrix[Math.floor(Math.random() * matrix.length)];
    ctx.fillText(text, i * fontSize, drops[i] * fontSize);

    if (drops[i] * fontSize > canvas.height && Math.random() > 0.975) {
      drops[i] = 0;
    }
    drops[i]++;
  }
}

// run the animation
setInterval(draw, 33);

// resize canvas when window changes
window.addEventListener("resize", () => {
  canvas.height = window.innerHeight;
  canvas.width = window.innerWidth;
});






 function animate() {
            const image = document.getElementById('image');
            const ctx = image.getContext('2d');
            image.width = 980;
            image.height = 520;

            ctx.drawImage(myImage, 0, 0, image.width, image.height);
            const pixels = ctx.getImageData(0, 0, image.width, image.height);
            ctx.clearRect(0, 0, image.width, image.height);

            let particlesArray = [];
            const numberOfParticles = 7000;

            let mappedImage = [];
            for (let y = 0; y < image.height; y++) {
                let row = [];
                for (let x = 0; x < image.width; x++) {
                    const index = (y * 4 * pixels.width) + (x * 4);
                    const red = pixels.data[index];
                    const green = pixels.data[index + 1];
                    const blue = pixels.data[index + 2];
                    const brightness = calculateRelativeBrightness(red, green, blue);
                    row.push({
                        brightness: brightness,
                        color: `rgb(${red},${green},${blue})`
                    });
                }
                mappedImage.push(row);
            }

            function calculateRelativeBrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 + (green * green) * 0.587 + (blue * blue) * 0.114
                ) / 100;
            }

            class Particle {
                constructor() {
                    this.x = Math.random() * image.width;
                    this.y = 0;
                    this.speed = 0;
                    this.velocity = Math.random() * 0.5;
                    this.size = Math.random() * 1.5 + 1;
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                    this.color = 'white';
                }

                update() {
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                    if (mappedImage[this.position1] && mappedImage[this.position1][this.position2]) {
                        this.speed = mappedImage[this.position1][this.position2].brightness;
                        this.color = mappedImage[this.position1][this.position2].color;
                    }
                    let movement = (2.5 - this.speed) + this.velocity;
                    this.y += movement;
                    if (this.y >= image.height) {
                        this.y = 0;
                        this.x = Math.random() * image.width;
                    }
                }

                draw() {
                    ctx.beginPath();
                    ctx.fillStyle = this.color;
                    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                    ctx.fill();
                }
            }

            function init() {
                for (let i = 0; i < numberOfParticles; i++) {
                    particlesArray.push(new Particle);
                }
            }
            init();

            let animationActive = true; // control animation state

            function animate() {
                if (!animationActive) return; // stop animation after 5 sec

                ctx.globalAlpha = 0.05;
                ctx.fillStyle = 'rgb(0,0,0)';
                ctx.fillRect(0, 0, image.width, image.height);
                ctx.globalAlpha = 0.2;
                for (let i = 0; i < particlesArray.length; i++) {
                    particlesArray[i].update();
                    ctx.globalAlpha = particlesArray[i].speed * 0.5;
                    particlesArray[i].draw();
                }
                requestAnimationFrame(animate);
            }
            animate();

            // After 5 seconds, stop the animation and draw the normal image
            setTimeout(() => {
                animationActive = false;
                ctx.clearRect(0, 0, image.width, image.height);
                ctx.globalAlpha = 1.0; // reset opacity
                ctx.drawImage(myImage, 0, 0, image.width, image.height);
            }, 10000);
            
        }

const myImage = new Image();
        // Replace with your Base64 string
        myImage.src='data:image/jpeg;base64,'
        myImage.addEventListener('load',animate);
        image.addEventListener('mouseenter',animate);